import HeroSection from './components/HeroSection';
import Navigation from './components/Navigation';
import './styles/globals.css';

function App() {
  return (
    <div style={{
      backgroundColor: '#0A0B0F',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      <Navigation />

      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
      }}>
        <HeroSection />

        <div style={{
          position: 'relative',
          width: '600px',
          height: '600px',
          animation: 'fadeIn 1s ease-out',
        }}>
          {/* Neural Network Background */}
          <div style={{
            position: 'absolute',
            width: '100%',
            height: '100%',
            opacity: 0.1,
            animation: 'pulse 4s infinite ease-in-out',
            background: `
              radial-gradient(circle at 20% 20%, #61DAFB 1px, transparent 1px) 0 0/20px 20px,
              radial-gradient(circle at 60% 60%, #61DAFB 1px, transparent 1px) 0 0/20px 20px,
              radial-gradient(circle at 40% 80%, #61DAFB 1px, transparent 1px) 0 0/20px 20px
            `,
          }} />

          {/* Main Brain Visualization */}
          <div style={{
            position: 'absolute',
            width: '400px',
            height: '400px',
            top: '50%',
            right: '50px',
            transform: 'translateY(-50%)',
            borderRadius: '50%',
            background: 'linear-gradient(45deg, rgba(97, 218, 251, 0.1), rgba(97, 218, 251, 0.05))',
            border: '2px solid rgba(97, 218, 251, 0.2)',
            overflow: 'hidden',
            animation: 'pulse 4s infinite ease-in-out',
          }}>
            {/* Neural Connections */}
            {Array.from({ length: 5 }).map((_, i) => (
              <div key={`connection-${i}`} style={{
                position: 'absolute',
                width: '200%',
                height: '2px',
                background: 'linear-gradient(90deg, transparent, rgba(97, 218, 251, 0.2), transparent)',
                top: `${20 + i * 20}%`,
                left: '-50%',
                transform: `rotate(${i * 36}deg)`,
                animation: `scan ${3 + i}s infinite linear`,
              }} />
            ))}

            {/* AI Nodes */}
            {Array.from({ length: 8 }).map((_, i) => (
              <div key={`node-${i}`} style={{
                position: 'absolute',
                width: '20px',
                height: '20px',
                backgroundColor: 'rgba(97, 218, 251, 0.3)',
                borderRadius: '50%',
                top: `${30 + Math.sin(i * 45) * 40}%`,
                left: `${30 + Math.cos(i * 45) * 40}%`,
                animation: `pulse ${2 + i * 0.2}s infinite ease-in-out ${i * 0.1}s`,
                boxShadow: '0 0 20px rgba(97, 218, 251, 0.5)',
              }} />
            ))}
          </div>

          {/* Floating Data Streams */}
          {Array.from({ length: 3 }).map((_, i) => (
            <div key={`stream-${i}`} style={{
              position: 'absolute',
              width: '150px',
              padding: '10px',
              backgroundColor: 'rgba(97, 218, 251, 0.05)',
              borderRadius: '8px',
              backdropFilter: 'blur(5px)',
              border: '1px solid rgba(97, 218, 251, 0.2)',
              top: `${20 + i * 30}%`,
              right: `${10 + i * 15}%`,
              transform: `rotate(${-5 + i * 5}deg)`,
              animation: `float ${3 + i}s infinite ease-in-out ${i * 0.5}s`,
            }}>
              <div style={{
                color: '#61DAFB',
                fontSize: '12px',
                fontFamily: 'monospace',
                overflow: 'hidden',
                whiteSpace: 'nowrap',
                animation: 'typewriter 3s infinite linear',
              }}>
                {`{data: ${(i + 1) * 1000}, AI: true}`}
              </div>
            </div>
          ))}

          {/* Energy Particles */}
          {Array.from({ length: 15 }).map((_, i) => (
            <div key={`particle-${i}`} style={{
              position: 'absolute',
              width: `${4 + Math.random() * 4}px`,
              height: `${4 + Math.random() * 4}px`,
              backgroundColor: '#61DAFB',
              borderRadius: '50%',
              top: `${Math.random() * 100}%`,
              right: `${Math.random() * 100}%`,
              opacity: 0.6,
              animation: `
                particle ${5 + Math.random() * 5}s infinite linear ${Math.random() * 2}s,
                glow 2s infinite ease-in-out ${Math.random()}s
              `,
            }} />
          ))}

          {/* Holographic Interface Elements */}
          {Array.from({ length: 3 }).map((_, i) => (
            <div key={`holo-${i}`} style={{
              position: 'absolute',
              width: '100px',
              height: '100px',
              border: '1px solid rgba(97, 218, 251, 0.3)',
              borderRadius: '10px',
              top: `${20 + i * 30}%`,
              right: `${60 + i * 10}%`,
              transform: `rotate(${45}deg)`,
              animation: `rotate ${10 + i * 2}s infinite linear`,
              background: 'linear-gradient(45deg, transparent 40%, rgba(97, 218, 251, 0.1) 45%, transparent 50%)',
              boxShadow: '0 0 30px rgba(97, 218, 251, 0.1)',
            }} />
          ))}
        </div>
      </main>
    </div>
  );
}

export default App;
